    38,nt"tags": [],nt"title": "Marine Biogeographic Assessment of the Main
    Hawaiian Islands: Synthesized physical and biological data offshore of the Main
    Hawaiian Islands from 1891-01-01 to 2015-03-01 (NCEI Accession 0155189)",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-01T23:24:41.786988",nt"name": "marine-biogeographic-assessment-of-the-main-hawaiian-islands-synthesized-physical-and-biologica",nt"isopen":
    false,nt"url": null,nt"notes": "The Bureau of Ocean Energy Management (BOEM)
    regulates the leasing, construction and operation of renewable energy projects in
    federal waters, and is required to evaluate potential human, coastal and marine
    impacts from these projects. In 2013, the National Oceanic and Atmospheric Administration
    (NOAA) National Centers for Coastal Ocean Science (NCCOS) partnered with BOEM to
    support their review of renewable energy lease requests offshore of the Main Hawaiian
    Islands (MHI). Collaborations with a variety of local federal, state, academic and
    non-governmental organizations were crucial for this work. NCCOS compiled existing,
    readily-available spatial data and synthesized new products around the MHI, describing
    the physical and biological marine environment, benthic habitats, fishes, sea turtles,
    marine mammals, and seabirds. Analyses and data products were specifically tailored
    to meet BOEMu00e2u0080u0099s needs, and to fit within BOEMu00e2u0080u0099s framework
    of offshore lease blocks. Data products range from simple animal distribution maps
    to mathematical models depicting the predicted distributions of animals. For some
    animals, this assessment marks the first time that their space-use patterns were
    mapped or modeled in the MHI, and made available online. These datasets are one
    component of the larger BOEM and State of Hawaiu00e2u0080u0098i processes to evaluate
    offshore renewable energy proposals around the MHI.",nt"license_title": null,nt"extras":
